import React from 'react';
import './App.css';
import {connect} from 'react-redux';
import Canvas from './Canvas.js';

function ConnectedApp() {
  return (
    <div className="App">
      <Canvas/>
    </div>
  );
}
const App = connect(null)(ConnectedApp);

export default App;
